import React from 'react';
import PostCard from './postCard.js';

const PostList = () => {

    return(
    <div class="my-12">
        <div class="flex -z-5 justify-center flex-wrap mx-100 lg:mx-4">
            <div class="my-1 px-1 w-full md:w-1/2 lg:my-4 lg:px-4 lg:w-3/6">
                <PostCard/>
                <PostCard/>
                <PostCard/>
                <PostCard/>
                <PostCard/>
                <PostCard/>
                <PostCard/>

            </div>
        </div>
    </div>
    );
};

export default PostList;
